<script>

/**
 * jQuery Plugin: Sticky Tabs
 *
 * @author Aidan Lister <aidan@php.net>
 * adapted by Ruben Arslan to activate parent tabs too
 * http://www.aidanlister.com/2014/03/persisting-the-tab-state-in-bootstrap/
 */
(function($) {
  "use strict";
  $.fn.rmarkdownStickyTabs = function() {
    var context = this;
    // Show the tab corresponding with the hash in the URL, or the first tab
    var showStuffFromHash = function() {
      var hash = window.location.hash;
      var selector = hash ? 'a[href="' + hash + '"]' : 'li.active > a';
      var $selector = $(selector, context);
      if($selector.data('toggle') === "tab") {
        $selector.tab('show');
        // walk up the ancestors of this element, show any hidden tabs
        $selector.parents('.section.tabset').each(function(i, elm) {
          var link = $('a[href="#' + $(elm).attr('id') + '"]');
          if(link.data('toggle') === "tab") {
            link.tab("show");
          }
        });
      }
    };


    // Set the correct tab when the page loads
    showStuffFromHash(context);

    // Set the correct tab when a user uses their back/forward button
    $(window).on('hashchange', function() {
      showStuffFromHash(context);
    });

    // Change the URL when tabs are clicked
    $('a', context).on('click', function(e) {
      history.pushState(null, null, this.href);
      showStuffFromHash(context);
    });

    return this;
  };
}(jQuery));

window.buildTabsets = function(tocID) {

  // build a tabset from a section div with the .tabset class
  function buildTabset(tabset) {

    // check for fade and pills options
    var fade = tabset.hasClass("tabset-fade");
    var pills = tabset.hasClass("tabset-pills");
    var navClass = pills ? "nav-pills" : "nav-tabs";

    // determine the heading level of the tabset and tabs
    var match = tabset.attr('class').match(/level(\d) /);
    if (match === null)
      return;
    var tabsetLevel = Number(match[1]);
    var tabLevel = tabsetLevel + 1;

    // find all subheadings immediately below
    var tabs = tabset.find("div.section.level" + tabLevel);
    if (!tabs.length)
      return;

    // create tablist and tab-content elements
    var tabList = $('<ul class="nav ' + navClass + '" role="tablist"></ul>');
    $(tabs[0]).before(tabList);
    var tabContent = $('<div class="tab-content"></div>');
    $(tabs[0]).before(tabContent);

    // build the tabset
    var activeTab = 0;
    tabs.each(function(i) {

      // get the tab div
      var tab = $(tabs[i]);

      // get the id then sanitize it for use with bootstrap tabs
      var id = tab.attr('id');

      // see if this is marked as the active tab
      if (tab.hasClass('active'))
        activeTab = i;

      // remove any table of contents entries associated with
      // this ID (since we'll be removing the heading element)
      $("div#" + tocID + " li a[href='#" + id + "']").parent().remove();

      // sanitize the id for use with bootstrap tabs
      id = id.replace(/[.\/?&!#<>]/g, '').replace(/\s/g, '_');
      tab.attr('id', id);

      // get the heading element within it, grab it's text, then remove it
      var heading = tab.find('h' + tabLevel + ':first');
      var headingText = heading.html();
      heading.remove();

      // build and append the tab list item
      var a = $('<a role="tab" data-toggle="tab">' + headingText + '</a>');
      a.attr('href', '#' + id);
      a.attr('aria-controls', id);
      var li = $('<li role="presentation"></li>');
      li.append(a);
      tabList.append(li);

      // set it's attributes
      tab.attr('role', 'tabpanel');
      tab.addClass('tab-pane');
      tab.addClass('tabbed-pane');
      if (fade)
        tab.addClass('fade');

      // move it into the tab content div
      tab.detach().appendTo(tabContent);
    });

    // set active tab
    $(tabList.children('li')[activeTab]).addClass('active');
    var active = $(tabContent.children('div.section')[activeTab]);
    active.addClass('active');
    if (fade)
      active.addClass('in');

    if (tabset.hasClass("tabset-sticky"))
      tabset.rmarkdownStickyTabs();
  }

  // convert section divs with the .tabset class to tabsets
  var tabsets = $("div.section.tabset");
  tabsets.each(function(i) {
    buildTabset($(tabsets[i]));
  });
};

</script>

    return paddingObj.top + "px " + paddingObj.right + "px " + paddingObj.bottom + "px " + paddingObj.left + "px";

        cel.style.right = pad.right + "px";
        cel.style.bottom = pad.bottom + "px";
        cel.style.left = pad.left + "px";
        el.style.width = "100%";
        el.style.height = "100%";

      // we will make an output binding object that delegates to the
      // definition. This is because we foolishly used the same method
      // name (renderValue) for htmlwidgets definition and Shiny bindings

      // bindings receive data that includes lots of metadata that it
      // strips off before calling htmlwidgets renderValue). We can't
      // just ignore the difference because in some widgets it's helpful
      // to call this.renderValue() from inside of resize(), and if

      // version instead of the htmlwidgets version.

      delegateMethod(shinyBinding, bindingDef, "getId");

          // Shiny can call resize before initialize/renderValue have been
          // called, which doesn't make sense for widgets.
          if (elementData(el, "initialized")) {

  var scheduleStaticRenderTimerId = null;

  // Render static widgets after the document finishes loading
  // Statically render all elements that are of this widget's class

          // app, but the widget itself is not a Shiny output, but
          // rather a simple static widget. One example of this is

          // flips slides between display:none and display:block.
          // Ideally we would not have to have ioslide-specific code
          // here, but rather have ioslides raise a generic event,
          // but the rmarkdown package just went to CRAN so the
          // window to getting that fixed may be long.
          if (window.addEventListener) {

            // browsers because ioslides itself only supports
            // such browsers.
            on(document, "slideenter", resizeHandler);
            on(document, "slideleave", resizeHandler);
          }

        var scriptData = document.querySelector("script[data-for='" + el.id + "'][type='application/json']");
        if (scriptData) {
          var data = JSON.parse(scriptData.textContent || scriptData.text);
          // Resolve strings marked as javascript literals to objects
          if (!(data.evals instanceof Array)) data.evals = [data.evals];

          evalAndRun(data.jsHooks.render, initResult, [el, data.x]);

        } else if (typeof(length) !== "undefined" && length !== df[name].length) {

        }

    }

  // Split value at splitChar, but allow splitChar to be escaped
  // using escapeChar. Any other characters escaped by escapeChar

  function splitWithEscape(value, splitChar, escapeChar) {

    var currentResult = "";

          results.push(currentResult);
          currentResult = "";

          escapeMode = true;
        } else {
          currentResult += value[pos];

    postRenderHandlers.push(callback);

  // to rewrite all the logic in this file to accomodate both
  // types of definitions.
  function createLegacyDefinitionAdapter(defn) {
    var result = {
      name: defn.name,
      type: defn.type,
      initialize: function(el, width, height) {
        return defn.factory(el, width, height);
      },
      renderValue: function(el, x, instance) {
        return instance.renderValue(x);
      },
      resize: function(el, width, height, instance) {
        return instance.resize(width, height);
      }
    };

    if (defn.find)
      result.find = defn.find;
    if (defn.renderError)
      result.renderError = defn.renderError;
    if (defn.clearError)
      result.clearError = defn.clearError;

    return result;
  }
})();

<style type="text/css">
img.leaflet-tile {
padding: 0;
margin: 0;
border-radius: 0;
border: none;
}
.info {

font: 14px/16px Arial, Helvetica, sans-serif;
background: white;
background: rgba(255,255,255,0.8);
box-shadow: 0 0 15px rgba(0,0,0,0.2);
border-radius: 5px;
}
.legend {
line-height: 18px;
color: #555;
}
.legend svg text {
fill: #555;
}
.legend svg line {
stroke: #555;
}
.legend i {
width: 18px;
height: 18px;
margin-right: 4px;
opacity: 0.7;
display: inline-block;
vertical-align: top;

*display: inline;
}

-webkit-transition: -webkit-transform 0.3s ease-out, opacity 0.3s ease-in;
-moz-transition: -moz-transform 0.3s ease-out, opacity 0.3s ease-in;
-o-transition: -o-transform 0.3s ease-out, opacity 0.3s ease-in;

}
.leaflet-cluster-spider-leg {

-webkit-transition: -webkit-stroke-dashoffset 0.3s ease-out, -webkit-stroke-opacity 0.3s ease-in;
-moz-transition: -moz-stroke-dashoffset 0.3s ease-out, -moz-stroke-opacity 0.3s ease-in;

}

<style type="text/css">.marker-cluster-small {
background-color: rgba(181, 226, 140, 0.6);
}
.marker-cluster-small div {
background-color: rgba(110, 204, 57, 0.6);
}
.marker-cluster-medium {
background-color: rgba(241, 211, 87, 0.6);
}
.marker-cluster-medium div {
background-color: rgba(240, 194, 12, 0.6);
}
.marker-cluster-large {
background-color: rgba(253, 156, 115, 0.6);
}
.marker-cluster-large div {
background-color: rgba(241, 128, 23, 0.6);
}

.leaflet-oldie .marker-cluster-small {
background-color: rgb(181, 226, 140);
}
.leaflet-oldie .marker-cluster-small div {
background-color: rgb(110, 204, 57);
}
.leaflet-oldie .marker-cluster-medium {
background-color: rgb(241, 211, 87);
}
.leaflet-oldie .marker-cluster-medium div {
background-color: rgb(240, 194, 12);
}
.leaflet-oldie .marker-cluster-large {
background-color: rgb(253, 156, 115);
}
.leaflet-oldie .marker-cluster-large div {
background-color: rgb(241, 128, 23);
}
.marker-cluster {
background-clip: padding-box;
border-radius: 20px;
}
.marker-cluster div {
width: 30px;
height: 30px;
margin-left: 5px;
margin-top: 5px;
text-align: center;
border-radius: 15px;
font: 12px "Helvetica Neue", Arial, Helvetica, sans-serif;
}
.marker-cluster span {
line-height: 30px;
}</style>

6161543397813,3.01122924228318,2.47504553055064,2.32639871711152,2.80239201748714,2.09594624688288,2.68268708878265,2.44805852493881,2.47582645977134,2.1859107961009,2.11100928426767,2.45681703498169,2.990587523649,2.58606613733885],{"icon":"home","markerColor":"red","iconColor":"black","spin":false,"squareMarker":false,"iconRotate":0,"font":"monospace","prefix":"glyphicon"},null,"BASOL",{"interactive":true,"draggable":false,"keyboard":true,"title":"","alt":"","zIndexOffset":0,"opacity":1,"riseOnHover":false,"riseOffset":250},["<span class=\"marine\"><\/span>","<span class=\"marine\">L'enfouissement de dchets industriels banals, c'est--dire assimilables  des ordures mnagres, avait t autoris dans la dcharge d'HODENC en BRAY. Cependant, au dbut des annes 70, des dchets industriels autres que ceux prvus y ont t admis.<\/span>","<span class=\"marine\">L'usine Salpa, ferme en 1977, a engendr un dpt de dchets de cuir et de plastique d'environ 13 000 tonnes.<br><br>\r\nEn 2012, un des transformateurs contenant potentiellement des PCB encore prsent sur le site a t vandalis.<br><br><\/span>","<span class=\"marine\">En 1976, des dchets industriels liquides ont t dverss dans cette dcharge en infraction avec les mesures imposes. L'exploitant a t mis en demeure par arrt prfectoral du 26 octobre 1976 de remettre en tat le site et de contrler la nappe souterraine. Les liquides ont t pomps.<\/span>","<span class=\"marine\">Ancienne carrire de craie phosphate, en partie  ciel ouvert, en partie souterraine. En 1975, des dchets industriels liquides ont t dverss dans la partie  ciel ouvert et des fts de dchets industriels ont t stocks dans les galeries souterraines. <\/span>","<span class=\"marine\">L'existence de l'ancienne dcharge LOUYOT a t porte  la connaissance de l'Inspection des Installations Classes au dbut de l'anne 1992, par les reprsentants de la municipalit.<br><br>\r\nLa Socit LOUYOT, reprise depuis par la Socit COMPTOIR LYON ALEMAND LOUYOT, est rpute avoir exploit le site jusqu'au dbut des annes 1960 pour y enfouir des dchets industriels tels des rfractaires uss provenant de ses fours de fusion. Elle tait spcialise dans la fabrication de mtaux non ferreux  base essentiellement de Cuivre, de Nickel ou de Zinc.<br><br>\r\nAujourd'hui, le site est un talus naturel remblay sur lequel une vgtation arbustive s'est implante.<\/span>","<span class=\"marine\">Site en zone urbaine, bord par deux rus afflents de la rivire Le Thrain. Il est  l'tat de friche herbeuse ou boise.<br>\r\nCe site est spar par un ru d'un autre site galement pollu suite aux activits de l'ancienne usine  gaz de Beauvais. L'usage de ce second site tant de plus diffrent (implantation des installations actuelles EDF et de GDF  Beauvais), il fait l'objet d'une autre fiche.<\/span>","<span class=\"marine\">Cette ancienne carrire d'argile a t en partie comble par des dchets bitumeux. La vgtation s'est en partie implante sur la couverture de terre et de dblais apporte sur les dpts. Une surveillance pizomtrique est assure.<\/span>","<span class=\"marine\">Le site de Suzoy est une ancienne carrire de matriaux silico-calcaires qui a t utilise tout d'abord comme dcharge d'ordures mnagres. Elle a ensuite reu plusieurs milliers de tonnes de dchets issus de l'unit RHONE POULENC  RIBECOURT (boues de stations d'puration, dchets barytiques).<br><br>\r\nCette dcharge (rglemente par arrt prfectoral du 27 dcembre 1985) a cess son activit en 1990.<\/span>","<span class=\"marine\"> la fin de l'anne 1974, aprs plusieurs procs-verbaux dresss  l'encontre des exploitants successifs ayant tous des liens <br>\r\njuridiques, financiers ou familiaux entre eux, de l'inspection des installations classes et de la gendarmerie, l'activit de la <br>\r\ndcharge de dchets industriels de VILLEMBRAY cessait. Ds cette poque, deux campagnes de mesures  cet effet, effectues <br>\r\npar les sapeurs pompiers de Beauvais d'une part, et par l'APAVE  AMIENS d'autre part, n'avaient pas mis en vidence de <br>\r\nmanifestation radioactive.<br><br>\r\nPar la suite, diverses mesures furent prescrites, tant pour amliorer la connaissance des effets des dpts sur l'environnement <br>\r\nque pour renforcer la scurit du site. En particulier, l'arrt prfectoral du 28 avril 1984 a instaur  la charge de la socit <br>\r\nSEIC, propritaire du site et dtentrice des dchets enfouis, un suivi analytique de la qualit des eaux souterraines, et a <br>\r\ninstaur des servitudes destines  prvenir toute intervention pouvant compromettre la situation des dpts. Le Tribunal <br>\r\nAdministratif n'a pas accd  la demande d'annulation prsente par la SEIC pour cet acte.<br><br>\r\nLes carences rptes des dtenteurs des dchets, en dernier lieu Mme BEN CHETRIT, fille du dirigeant de la SEIC, ont donn <br>\r\nlieu  plusieurs procs-verbaux et mises en demeure prfectorales. Finalement, l'excution d'office des travaux ncessaires, <br>\r\naux frais de Mme BEN CHETRIT, a t confie  l'ADEME. Il s'agissait notamment d'analyser les eaux superficielles et <br>\r\nsouterraines, les manations gazeuses, de mesurer la radioactivit et de raliser une tude hydrogologique complte du site. <br>\r\nLe montant des travaux s'est lev  environ 1 MF.<br>\r\nles suivis priodiques de la qualit des eaux souterraines et superficielles au droit du site sont assurs par l'ADEME par arrt de travaux d'office du 16 septembre 2010.<br>\r\nUne forte dgradation des ouvrages pizomtriques a t constat en mars 2011. L'ADEME a reconfigur le suivi pizomtrique en suivant la qualit des eaux souterraines sur la base des pizomtres utilisables. Cette alternative  prsente plusieurs avantages : en terme de cout de mise en uvre et d'intrts techniques et scientifique du suivi. Les pizomtres utiliss ont les mmes caractristiques que ceux abandonns.<br><\/span>","<span class=\"marine\">Ancienne lagune dont la cration est antrieure  1940 et ayant reu jusqu'en 1975 les eaux rsiduaires de la plate-forme chimique suivies du dpt des dchets solides de la station d'puration et de l'usine.<br>\r\nL'exploitant a cess toute activit sur le site depuis 1999.<br><\/span>","<span class=\"marine\">Le site a t exploit entre 1960 et 1998 par diffrentes socits<br>\r\nsuccessives qui ont dvelopp la mme activit de recyclage d'aluminium<br>\r\npar fusion.<br><\/span>","<span class=\"marine\">La Socit STARE a exploit  VILLERS SUR COUDUN un atelier de traitement de surface  l'origine d'une contamination par du chrome hexavalent de l'eau du captage de VILLERS SUR COUDUN (en 1980).<br><br>\r\nEn 1988, la socit META MECA est devenue l'exploitant des installations.<br><br>\r\nEn septembre 1989, l'exploitation des installations a cess.<br><br><\/span>","<span class=\"marine\">Sur un site de 37 ha environ, travers par la rivire Le Thrain, la socit ADCLO exploitait des installations de fabrication d'huisseries mtalliques, de revtement de tles d'acier et de traitement chimique des mtaux.<br><br>\r\nAprs l'arrt des activits en 1984, des dchets divers ont t dlaisss sur le site (fts et bidons contenant des peintures, solvants,...). Des actes de malveillance ont galement entrain des dversements d'huiles et de PCB.<br><\/span>","<span class=\"marine\">La socit IDEAL STANDARD a exerc sur le site jusqu'en 1996 des activits de traitement de surfaces de robinetterie et tuyauterie flexible pour installations sanitaires.<br>\r\nLa socit espagnole DISFLEX devient grante du site en juillet 1996 puis la rachte en 1997 (dclaration en prfecture du 19/03/98). Le site et les btiments ont t diviss et vendus  plusieurs socits.<br>\r\nCompte tenu des importantes modifications qui ont eu lieu sur le site tant au niveau de l'activit que des installations la socit DISFLEX a dpos un dossier de demande de rgularistation de la situation administrative.<br>\r\nUn arrt prfectoral en date du 01/04/2004 rgularise cette socit.<br><\/span>","<span class=\"marine\">Le site de Liancourt a accueilli une usine fabriquant du gaz  partir de la distillation de la houille. Actuellement, il est utilis pour les besoins d'EDF/GDF.<\/span>","<span class=\"marine\">Le terrain est situ au centre ville. Il a une superficie denviron 1823 m et a accueilli de 1907  1933 une usine fabriquant du gaz  partir de la distillation de la houille. Les installations de lusine ont t dmanteles. Le gazomtre a t dtruit en 1969.<br>\r\nLusine na jamais t exploite par Gaz de France.<br><br>\r\nActuellement, la partie ouest du site est amnage en habitation avec jardin dagrment et potager pour un agent d'EDF/GDF.<br><\/span>","<span class=\"marine\">Le site actuellement proprit de EDF - Gaz de France est constitu par un terrain d'une surface de 7 997 m2 se trouvant 300 mtres au Sud du centre ville de Senlis. L'autorisation prfectorale pour l'tablissement d'une usine  gaz  Senlis date du 19 janvier 1866. <br><br>\r\nL'usine  gaz a cess son activit dans les annes 1960. Les trois gazomtres et les btiments des fours ont t dmantels. Seuls persistent actuellement de l'ancienne usine, deux btiments d'habitation (non utiliss) et des remises. Le site est  l'heure actuelle dsaffect. Les seules interventions des agents EDF- Gaz de France sur le site sont lies  un poste de coupure EDF,  un poste de transformation haute tension et  un dtendeur gaz.<\/span>","<span class=\"marine\">Le site est constitu par un terrain d'une superficie de 2 590 m2 se trouvant  300 mtres au Sud-Est du centre de ville de Neuilly-en-Thelle. La date de construction de l'usine  gaz n'est pas connue. La production de gaz de houille a t ralise sur le site jusqu'en juillet 1957. Aprs 1957, le site a t reconverti en station d'air propan utilisant une partie des anciennes structures de l'usine  gaz. Le site est  l'heure actuelle  l'tat de friche.<\/span>","<span class=\"marine\">Friche industrielle constitue de trois zones :<br>\r\n- la premire, dite \"secteur 1\", de surface 6 ha, sur laquelle se trouvaient les installations de production maintenant dmanteles ;<br>\r\n- la deuxime, dite \"secteur 2\" de surface 1 ha, renferme un dpt de carbure de calcium et un dpt de sables de fonderie ;<br>\r\n- la troisime, dite \"zone agricole\" de surface 4 ha, n'a pas t le sige d'activits industrielles ; elle est mise en culture.<\/span>","<span class=\"marine\">L'tablissement est situ dans une zone en voie d'urbanisation. Diffrents btiments y ont t utiliss en particulier pour des oprations de traitement de surface. Des mtaux lourds ont t mis en vidence dans le sous-sol de deux d'entre eux. Ces btiments ont t dmolis au dbut de l'anne 2002.<\/span>","<span class=\"marine\">Le site est localis sur la commune de BORNEL-Hameau de Montagny La Poterie. Le site est situ dans une zone d'habitats disperss  la cote NGF +95 m.La rivire \"Esches\", classe en 1re catgorie piscicole est situe  environ 2 km au Nord-Est du site.Le niveau pizomtrique de la nappe pizomtrique des sables du Thantien se situe  la cote NGF +58,5 m, soit  une profondeur de l'ordre de +37 m NGF par rapport au terrain naturel du site.Les premiers captages AEP sont situs en aval hydraulique du site  environ 2km.Il s'agit d'un ancien atelier de traitement de surface dont les premires activits ont dbutes en 1973.Diffrents exploitants se sont succds sur ce site dont les socits ont fait l'objet de liquidations judiciaires successives.La socit ST MEDARD ETERNUM est devenue propritaire du site  la fin de l'anne 1996.<\/span>","<span class=\"marine\">Des activits de teinturerie ont t exerces sur le site de Gouvieux en bordure de lOise par plusieurs socits successives et en dernier lieu par la socit SITO. Le site a ferm en 2000, anne o la socit SITO a t place en liquidation judiciaire.<br><br>\r\nDes prlvements et analyses ont t raliss entre 2002 et 2009 pour caractriser ltat de pollution du site. En vue dexaminer la possibilit dun nouvel usage pour ce site, une tude sanitaire a t ralise dbut 2009.<\/span>","<span class=\"marine\">Les activits de la socit EURAND ont t autorises par larrt prfectoral du 2 mars 1984. <br>\r\nLes activits sur ce site ont cess dfinitivement en juillet 2011.<\/span>","<span class=\"marine\">Les activits de RIGIDA sur ce site consistaient en la fabrication de jantes de vlo en aluminium.<br><br>\r\nLes activits ont dfinitivement cess en octobre 2009. La liquidation judiciaire de la socit RIGIDA a t prononce par le Tribunal de Commerce de Compigne le 18 septembre 2009. Un mmoire de cessation dactivit ralis par lAPAVE a t transmis  la Prfecture de lOise par le liquidateur judiciaire, Matre Herbaut, en avril 2010.<\/span>","<span class=\"marine\">Yoplait a exerc sur ce site des activits de fabrication de produits laitiers entre 1914 et 2006.<br>\r\nLa cessation d'activit a t notifie en 2008<\/span>","<span class=\"marine\">Ancienne usine de traitement de dchets de mtallurgie (zinc, plomb) de 1837  1992, dont le sol et le sous-sol sont pollus. Dbut 2000, l'exploitant a dmoli l'ensemble des btiments et vacu les dblais, ne laissant que les plate-formes des btiments et le mur d'enceinte.<br><\/span>","<span class=\"marine\">SODIMATEX tait spcialise dans la fabrication darticles non tisss  destination du secteur automobile et soumise  autorisation. La notification de cessation dactivits a t transmise au Prfet de lOise en octobre 2010. Les activits ont dfinitivement cess le 31 dcembre 2010.<br><br>\r\nLes usines U3 et U246 de SODIMATEX sont implantes dans le Parc dActivits  Les Portes du Valois  en priphrie de la commune de Crpy-en-Valois.<br><br>\r\nLenvironnement du site est caractris par :<br>\r\n- A lEst,  50 m : des sites industriels puis des champs agricoles  partir de 500 m ;<br>\r\n- Au Nord, en limite de proprit : des sites industriels puis  400 m une voie SNCF, et  700 m, des quartiers rsidentiels ;<br>\r\n- A lOuest,  100 m : des habitations ;<br>\r\n- Au Sud-Ouest,  500 m : des champs agricoles, un stade et des tablissements scolaires ;<br>\r\n- Au Sud,  50 m : des sites industriels.<br><\/span>","<span class=\"marine\">La socit Lorge&amp;Cie tait spcialise dans les oprations de dmontage, dmolition, rcupration de mtaux. Ctait galement une station de transit de dchets, de rsidus et d'appareil usags provenant notamment d'ICPE contenant, imprgns ou souills de fluides dilectriques chlors (PCB).<br><br>\r\nLactivit sur ce site a dbut en 1969.<br><br>\r\nLenvironnement du site est caractris par :<br>\r\n-\t lEst : la route nationale N16 ;<br>\r\n-\tau Nord : une route puis un complexe sportif (stade et centre nautique) ;<br>\r\n-\t lOuest et au Sud : des habitations (pavillons et immeubles).<br>\r\nLa superficie totale du site est de 22 000 m2<br><\/span>","<span class=\"marine\">Lentreprise RIETER exploitait sur ce site des installations de production de pices acoustiques  base de composites fibreux destines aux secteurs poids lourds, tracteurs et ferroviaires.<br><br>\r\nLes activits ont dfinitivement cess en aot 2010.<br><br>\r\nLe site de Rmy relevait du rgime de la dclaration au regard de la lgislation relative aux Installations Classes pour la Protection de lEnvironnement. Lexploitant disposait dun rcpiss de dclaration en date du 26 aot 1994.<br>\r\nL'exploitant avait dpos un dossier de rgularisation administrative de ses activits en 2005 compte-tenu de l'volution des activits du site. Le site tait class sous le rgime de l'autorisation pour les rubriques 2661-1 et 2940-2. Cependant il n'y a pas eu d'arrt prfectoral d'autorisation pour le nouveau rgime de l'tablissement.<br><br><\/span>","<span class=\"marine\">La socit POLYTITAN a exploit sur le territoire de la commune de Vineuil Saint Firmin, des installations classes soumises  autorisation entre 1957 et 2006. Le site tait spcialis dans la fabrication dadditif pour lindustrie du PVC.<br><br>\r\nLa cessation dactivit du site date de 2006. La liquidation judiciaire a t prononce le 18 juillet 2006.<br><br>\r\nLe site est bord : <br>\r\n-au nord, par la RD 924 puis des terres agricoles ;<br>\r\n- louest, par une zone boise ;<br>\r\n-au sud, par la Nonette (affluent de lOise) puis par les locaux de lancienne usine SOPAL. Ce site est actuellement est cours de transformation dans le cadre dun projet dhtellerie ;<br>\r\n- lest, par des terres agricoles.<br><br>\r\nLes premires maisons de la commune de Vineuil-Saint-Firmin sont situes  environ 300 m  louest du site.<br><br><br>\r\nLe site exploit par la socit Polytitan occupe une surface de 1,17 ha  lest de la commune de Vineuil.<br><br>\r\nLe bti est compos de 9 btiments (dont un  usage de bureaux) pour lesquels la surface varie de 110  570 m.<br><\/span>","<span class=\"marine\">Le prsent rapport concerne la cessation dactivits du site AGORA ex Force 5  Meru. Le site Force 5 est une cooprative agricole qui comportait 3 silos de 75 000 litres. Les activits ont dfinitivement cess en aot 2010.<br><br>\r\nLe site est localis entre la zone industrielle de Mru et le centre ville. <br>\r\nLenvironnement du site est caractris par :<br>\r\n- A lEst : une voie ferre et au-del des habitations individuelles ;<br>\r\n- Au Nord : une rue et au-del des habitations ;<br>\r\n- A lOuest : une rue et au-del un centre commercial et des immeubles dhabitations collectives ;<br>\r\n- Au Sud : lancien site de la fonderie Norinco.<br><br>\r\nLe site sinscrit en zone UM au Plan Local dUrbanisme (soit zone urbaine mixte de renouvellement urbain, accueillant de lhabitat, des activits et des quipements publics). Il nest pas class en zone inondable.<br><\/span>","<span class=\"marine\">Usine de fabrications de pneumatiques, jusqu'en 2009.<br>\r\nLe site, reprsentant une superficie de 16,17 ha, est localis  Clairoix, dans la zone urbaine  vocation dactivits industrielles entre : <br>\r\n-la rivire Oise  lest, <br>\r\n-la voie de chemin de fer  louest (liaison Compigne  Saint Quentin) <br>\r\n-la route dpartementale RD 81 au nord.<br><br>\r\nLtablissement se situe  environ 3,8 km au nord-est du centre de Compigne. Les habitations les plus proches se situent  moins de 50 m du site<\/span>","<span class=\"marine\">La fonderie est installe  Noyon depuis 1899. Le site occupe 6 ha  proximit de la gare de Noyon.<br><br>\r\nL'activit du site tait la fonderie de bronze pour la robinetterie avant la premire guerre mondiale puis la fonderie de fonte  partir des annes 1920 (production de baignoires en fonte maille de la marque Jacob Delafon).<br><br>\r\nL'activit du site a cess en 2006.<\/span>","<span class=\"marine\">La socit Montupet a exploit sur le site de Nogent sur Oise des installations de fonderie de l'aluminium pour le march automobile jusqu'en 2006.<br><br>\r\nLe site s'tend sur environ 35 000 m et les btiments occupent une surface de 23 000 m.<\/span>","<span class=\"marine\">L'usine ZF Sachs suspension France  Mouy avait une activit de fabrication de suspensions pour l'industrie automobile.<br><br>\r\nLe site d'environ 4,5 ha est situ au sud du centre-ville de Mouy. Il est bord :<br>\r\n- Au nord, par un petit cours deau, lEvque, puis par une industrie,<br>\r\n- A lest, par une voie ferre puis par une zone boise limite par un ruisseau le Thrain,<br>\r\n- Au sud, par une zone boise traverse par un petit cours deau puis par une industrie,<br>\r\n- A louest, par la D929 (avenue du 11 novembre) puis par des habitations.<br><br>\r\nLa production a cess en aot 2009.<\/span>","<span class=\"marine\">La socit PENOX SA, qui exploitait des installations de fabrication d'oxydes de plomb depuis 1911, tait spcialise dans la fabrication de litharge de plomb (PbO - rouge ou jaune en fonction de la temprature d'oxydation du plomb), de minium de plomb (Pb3O4)  partir de litharge, de plombate de calcium, de silicate de plomb et de litharge  haute teneur en plomb (L.H.T.P).<br><br>\r\nLe site est maintenant ferm et a fait l'objet d'une cessation d'activit.<br><br><br><\/span>","<span class=\"marine\">Site ayant exerc une activit de ngoce de produits chimiques comprenant pour l'essentiel des peroxydes organiques.<\/span>","<span class=\"marine\">Usine de fabrication d'accessoires pour l'automobile, de dispositifs pour systmes de freinage notamment. De l'amiante y a t mise en oeuvre de 1992  1996 pour produire des matriaux de friction.<br><br>\r\nLe site est localis  environ 1,2 km au Sud-Est du centre-ville de Beauvais,  environ 450 m au Sud-Est de la gare ferroviaire et  environ 200 m au Nord de la rivire Le Thrain.<\/span>","<span class=\"marine\">Le site d'Isollex occupe une superficie totale de 14 664 m dont 2880 m de surface couverte. Le terrain accueille un bassin  ciel ouvert de 40 m3 pour la rcupration des eaux de pluie.<br><br>\r\nAprs de nombreuses interventions de l'inspection des installations classes et plusieurs arrts prfectoraux de suspension d'activit, la socit Isollex a t mise en liquidation judiciaire en janvier 2004.<br><\/span>","<span class=\"marine\">Le site a accueilli de 1900  1920 une usine de lampes  arc. En 1921 la socit Desnoyers, y a install une unit de production de tubes en acier. Cette unit est passe sous le contrle de la socit Vallourec en 1969. L'activit a cess en septembre 2004.<br><br>\r\nLes btiments prsents sur le site occupent une surface de 22000 m3, le reste du terrain tant couvert par les voiries et des espaces boiss.<br>\r\nL'tablissement la limite de proprit Est du site est matrialis par la voie de chemin de fer reliant Paris  Amiens.<br>\r\nDes maisons et jardins individuels dlimitent l'tablissement  l'ouest et au sud.<br>\r\nLa rivire Brche se trouve  300 m  l'est du site<br>\r\nAu niveau du site, la nappe alluviale ne se situe qu' quelques mtres de profondeur.<\/span>","<span class=\"marine\">Ancienne usine de mtallurgie comprenant notamment des activits de fonderie, trempe et recuit de mtaux ainsi que des dpts de liquides inflammables.<br>\r\nLors de la cessation d'activit en 1991 l'exploitant, qui n'existe plus aujourd'hui, a laiss le site en l'tat sans le dpolluer.<br>\r\nEn 1994 la socit S.A. HLM LA SABLIERE a acquis ces terrains en vue d'y construire des logements sociaux.<br><\/span>","<span class=\"marine\">Les btiments ayant t dmantels, le site d'implantation des installations de l'ancienne usine CLAL, rue Gambetta  <br>\r\nBORNEL, se prsente sous forme de friche. Il est situ en zone urbanise. La rivire Esches le traverse.<br><br><\/span>","<span class=\"marine\">Le site se prsente maintenant comme une friche industrielle. Ancien dpt de stockage de fioul implant sur une parcelle de 2765 m dans laquelle les installations maintenant dmanteles occupaient une surface de 430 m. <br>\r\nLe site se trouve quartier de Marissel,  l'Est de la ville de Beauvais, dans un environnement de type industriel. Toutefois des habitations se trouvent  proximit, la plus proche  30 m  l'Ouest. Il est implant dans la valle de la rivire \"Le Thrain\", entre deux ruisseaux, l'un  200 m au Sud, l'autre  100 m au Nord.<br>\r\nAu droit du site, la nappe souterraine se trouve  1 m de profondeur environ, dans les tourbes. Il s'agit de la nappe des formations alluviales, en communication avec celle de la craie, localement exploite pour l'alimentation publique. Les captages d'alimentation en eau potable de la ville de Beauvais se situent en amont hydraulique,  3.5 km.  <br><\/span>","<span class=\"marine\">Ancienne usine de traitement de dchets de mtallurgie (zinc, plomb) de 1837  1992, dont le sol et le sous-sol sont pollus. Dbut 2000, l\\'exploitant a dmoli l\\'ensemble des btiments et vacu les dblais, ne laissant que les plate-formes des btiments et le mur d\\'enceinte.<br><\/span>","<span class=\"marine\">De 1929  fin 2003 l'activit sur le site a consist en la fabrication d'enrobs pour l'industrie automobile en particulier utiliss dans les systmes de freinage et d'embrayage. Diffrents produits ont t utiliss sur le site comme le xylne, le trichlothylne, le perchlorthylne, les peintures, les solvants et l'amiante.<br><\/span>"],null,{"showCoverageOnHover":true,"zoomToBoundsOnClick":true,"spiderfyOnMaxZoom":true,"removeOutsideVisibleBounds":true,"spiderLegPolylineOptions":{"weight":1.5,"color":"#222","opacity":0.5},"free
